function estratificacrown(codigo) {
    var jsonEstratificado = {};
    var fabrica = codigo.slice(0, 3);
    jsonEstratificado.fornecedor = "CROWN";
    jsonEstratificado.sequencial = codigo;
     switch (fabrica) {
        case 'UBR':
            jsonEstratificado.fabrica='UBERABA-MG';
        break;

        case 'CBV':
            jsonEstratificado.fabrica='CABREUVA-SP';
        break;

        case Default:
            jsonEstratificado.fabrica=fabrica;
        break;

    }
    return jsonEstratificado;
}
